import React from "react";
import './style/RightColumnStyle.css';
import { AiFillCaretRight } from "react-icons/ai";
import { AiFillSmile } from "react-icons/ai";
function RightColumn() {
    return (
        <div className="left-column">
        <h2>notification</h2>
            <ul>
                <li class="notification"><AiFillSmile />Dashboard </li>
                <li class="notification"><AiFillSmile />Default</li>
                <li class="notification"><AiFillSmile />eCommerce</li>
                <li class="notification"><AiFillSmile />Projects</li>
            </ul>

        </div>
    );
}

export default RightColumn;
